import Chip from '@material-ui/core/Chip';

const Style = {
    html: {
        backgroundColor: 'orange',
        color: 'white',
        fontWeight: 'bolder'
    }
};

export default class ChipsHTML extends Component {
    render() {
        return (
            <Chip label="Bootstrap" style={Style.html}/>
        );
    }
}
